pragma solidity >0.5.0;

contract Wallt1{
    address public owner;

    mapping (address => uint) public walletBalance;
    mapping (address => uint) public allowance;

    constructor () public {
        owner = msg.sender;
    }

    modifier ownerCheck {
        require(msg.sender == owner, "NonOwnerException");
        _;
    }

    fallback() external payable {
        walletBalance[msg.sender] = msg.value;
    }

    function setAllowance (address _member, uint _allowance) public ownerCheck{
        allowance[_member] = _allowance;
    }

    function withdrawFunds(address payable _to, uint _amount) public {
        _to.transfer(_amount);
    }

}

